import React from 'react';
import OIP from '../../assetes/OIP.jpg'; // Adjust the path if necessary

const Dashboard = () => {
    return (
        <div className='w-screen flex'>
            <div className='w-[25%] border border-black h-screen bg-secondary'>
                <div className='flex justify-center items-center my-8'>
                    <img src={OIP} width={75} height={75} alt="User" />
                    <div className='ml-8'>
                        <h3 className='text-2xl'>Tutorials Dev</h3> {/* Add content to h3 */}
                        <p className='text-lg font-light'>My Account</p>
                    </div>
                </div>
                <hr />
            </div>
            <div className='w-[50%] border border-black h-screen'></div> {/* Corrected class names */}
            <div className='w-[25%] border border-black h-screen'></div> {/* Corrected class names */}
        </div>
    );
}

export default Dashboard;
